// MyListings.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const MyListings = () => {
  const [myListings, setMyListings] = useState([]);

  useEffect(() => {
    // Fetch listings logic here
    const fetchMyListings = async () => {
      // Assuming you have an endpoint to fetch user's listings
      const response = await axios.get("http://localhost:5001/api/my-listings");
      setMyListings(response.data);
    };

    fetchMyListings();
  }, []);

  return (
    <div>
      <h1>My Listings</h1>
      {myListings.map(listing => (
        <div key={listing._id}>
          {/* Display listing details */}
          <p>{listing.name}</p>
          {/* Other details */}
        </div>
      ))}
    </div>
  );
};

export default MyListings;
